import React from 'react'
import { Link } from 'react-router-dom'

export default function Header () {

    return (
        <div className="ui container">
            <div className="ui secondary pointing menu">
                <Link to="/" className="item">RTS Labs Project</Link>
            </div>
        </div>
    )
}
